$(window).on("load",function(){$("#mail-form").on("submit",function(b){b.preventDefault();console.log($(this).serialize());var a=$(this);$("#form-sending").show();$("#mail-form").hide();$.ajax({method:"GET",url:"https://submit.carlgo11.com/",dataType:"text",cache:false,data:a.serialize(),success:function(){$("#form-sending").hide();$("#form-success").fadeIn().alert()},error:function(){$("#form-sending").hide();$("#form-error").fadeIn().alert()}})})});